var $form = $('form#contact-form'),
url = 'https://script.google.com/macros/s/AKfycbyUkrs8kQoFpzRfNRGD7dzlmfhHPPzDNgCb33z4rQiIJE6L4AKgKU6O9Fp1Ewmzv76wKA/exec'

$('#submit-form').on('click', function (e) {
e.preventDefault();
    var jqxhr = $.ajax({
        url: url,
        method: "GET",
        dataType: "json",
        data: $form.serialize(),
        success: function (rooms) {
            // do something
            console.log("success");
            $("#contact-form > div:nth-child(1) > div.alert.alert-success.col-12").removeAttr('hidden');
        }
    });
})